    display: flex;
    align-items: flex-end;
    gap: 10px;
    flex-wrap: wrap;
    background-color: #fff;
    padding: 20px;
    box-shadow: 0px 0px 5px #ccc;
    border-radius: 5px; 
    flex-direction: column;
`;

const InputArea =Styled.div`
    display: flex;
    flex-direction: column;
`;

const Form = ({ onEdit }) => {
    const ref = useRef();

    return (
        <FormContainer>
            <h2>Funcionários</h2>
            <InputArea>
            <label>CPF do Funcionário</label>
            <input name='cpf' type='text'/>
            </InputArea>
            <InputArea>
            <label></label>
            </InputArea>
        </FormContainer>
    );
};

export default Form;
